import phones from "../../data/phone_list";
import lasPhones from "../../data/las_phones";

const getDeviceData = () => {
  let i = 0;
  let searchDevice = [];

  phones['phones'].forEach(phone => {
    const container = require(`../../data/phones/${phone}.json`);
    const changeName = container => !container ? "" : container

    const changeUser = (container) => {
      if (!container) return ""
      if (!container.line[0]) return ""
      if (!container.line[0].displayAscii) return ""
      return container.line[0].displayAscii
    }

    const changeLine = (container) => {
      if (!container) return ""
      if (!container.line[0]) return ""
      if (!container.line[0].dirn) return ""
      if (!container.line[0].dirn.pattern) return ""
      return container.line[0].dirn.pattern
    }

    const changeMask = (container) => {
      if (!container) return ""
      if (!container.line[0]) return ""
      if (!container.line[0].e164Mask) return ""
      return container.line[0].e164Mask
    }

    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: changeName(container.resources[0].data.name.toUpperCase())
      },
      {
        key: i,
        type: "product",
        data: container.resources[0].data.product
      },
      {
        key: i,
        type: "user",
        data: changeUser(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "primary",
        data: changeLine(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "mask",
        data: changeMask(container.resources[0].data.lines)
      },
      {
        key: i,
        type: "ip",
        data: changeName(container.resources[0].data.ip_address)
      },
      {
        key: i,
        type: "location",
        data: container.resources[0].meta.hierarchy.split("_").pop().toLowerCase()
      }
    ]);
  });

  lasPhones['devices'].forEach(device => {
    searchDevice.push([
      {
        key: i,
        type: "mac",
        data: device.mac
      },
      {
        key: i,
        type: "product",
        data: ""
      },
      {
        key: i,
        type: "user",
        data: device.user
      },
      {
        key: i,
        type: "line",
        data: device.line
      },
      {
        key: i,
        type: "mask",
        data: ""
      },
      {
        key: i,
        type: "ip",
        data: ""
      },
      {
        key: i,
        type: "location",
        data: "LAS"
      }
    ]);
  });

  i++;
  searchDevice.forEach(e => {if (!e[1].data) e[1].data = ""})

  return searchDevice;
};

export default getDeviceData();
